import React, { useEffect, useState } from 'react';

interface Tranzactie {
  IDTranzactie: number;
  IDUtilizator: number;
  Suma: number;
  TipTranzactie: string;
  DataTranzactie: string;
}

const Tranzactii: React.FC = () => {
  const [tranzactii, setTranzactii] = useState<Tranzactie[]>([]);

  useEffect(() => {
    const mockData: Tranzactie[] = [
      {
        IDTranzactie: 1,
        IDUtilizator: 101,
        Suma: 200,
        TipTranzactie: 'Depunere',
        DataTranzactie: '2025-06-01T10:00:00',
      },
      {
        IDTranzactie: 2,
        IDUtilizator: 101,
        Suma: 100,
        TipTranzactie: 'Retragere',
        DataTranzactie: '2025-06-02T14:45:00',
      },
      {
        IDTranzactie: 3,
        IDUtilizator: 101,
        Suma: 300,
        TipTranzactie: 'Depunere',
        DataTranzactie: '2025-06-03T12:15:00',
      },
    ];

    setTranzactii(mockData);
  }, []);

  const getTransactionIcon = (tip: string) => {
    return tip === 'Depunere' ? 'ðŸ’°' : 'ðŸ’¸';
  };

  const getTransactionColor = (tip: string) => {
    return tip === 'Depunere' ? '#059669' : '#dc2626';
  };

  const getTransactionBgColor = (tip: string) => {
    return tip === 'Depunere' ? '#d1fae5' : '#fee2e2';
  };

  const getTotalBalance = () => {
    return tranzactii.reduce((total, t) => {
      return t.TipTranzactie === 'Depunere' ? total + t.Suma : total - t.Suma;
    }, 0);
  };

  return (
    <div
      style={{
        minHeight: '100vh',
        backgroundImage: "url('/images/background-casino.jpg')",
        backgroundSize: 'cover',
        backgroundPosition: 'center',
        backgroundRepeat: 'no-repeat',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'flex-start',
        paddingTop: '4rem',
        paddingBottom: '4rem',
      }}
    >
      <div className="p-6 max-w-4xl w-full bg-black bg-opacity-70 rounded-md shadow-md text-white">
        <div style={{ 
          textAlign: 'center',
          marginBottom: '32px'
        }}>
          <h1 style={{ 
            fontSize: '36px', 
            fontWeight: 'bold', 
            color: 'white', 
            marginBottom: '12px',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            gap: '12px'
          }}>
            ðŸ’³ Istoric TranzacÈ›ii
          </h1>
          
          <div style={{
            display: 'inline-block',
            padding: '12px 24px',
            backgroundColor: getTotalBalance() >= 0 ? '#dcfce7' : '#fee2e2',
            borderRadius: '12px',
            border: `2px solid ${getTotalBalance() >= 0 ? '#16a34a' : '#dc2626'}`,
            marginTop: '8px',
            color: getTotalBalance() >= 0 ? '#16a34a' : '#dc2626',
            fontWeight: '800',
            fontSize: '24px',
          }}>
            Sold Total: {getTotalBalance().toLocaleString('ro-RO')} RON
          </div>
        </div>

        <div style={{ 
          backgroundColor: 'white', 
          borderRadius: '16px', 
          boxShadow: '0 20px 25px -5px rgba(0, 0, 0, 0.1)', 
          overflow: 'hidden',
          border: '1px solid #e2e8f0'
        }}>
          <table style={{ 
            width: '100%', 
            borderCollapse: 'collapse',
            backgroundColor: 'white'
          }}>
            <thead>
              <tr style={{ 
                background: 'linear-gradient(90deg, #6366f1 0%, #4f46e5 100%)', 
                color: 'white' 
              }}>
                <th style={{ 
                  padding: '20px 24px', 
                  textAlign: 'left', 
                  fontSize: '14px', 
                  fontWeight: '700', 
                  textTransform: 'uppercase', 
                  letterSpacing: '0.1em' 
                }}>
                  Tip TranzacÈ›ie
                </th>
                <th style={{ 
                  padding: '20px 24px', 
                  textAlign: 'right', 
                  fontSize: '14px', 
                  fontWeight: '700', 
                  textTransform: 'uppercase', 
                  letterSpacing: '0.1em' 
                }}>
                  Suma
                </th>
                <th style={{ 
                  padding: '20px 24px', 
                  textAlign: 'center', 
                  fontSize: '14px', 
                  fontWeight: '700', 
                  textTransform: 'uppercase', 
                  letterSpacing: '0.1em' 
                }}>
                  Data & Ora
                </th>
                <th style={{ 
                  padding: '20px 24px', 
                  textAlign: 'center', 
                  fontSize: '14px', 
                  fontWeight: '700', 
                  textTransform: 'uppercase', 
                  letterSpacing: '0.1em' 
                }}>
                  Status
                </th>
              </tr>
            </thead>
            <tbody>
              {tranzactii.map((t, index) => (
                <tr 
                  key={t.IDTranzactie}
                  style={{ 
                    backgroundColor: index % 2 === 0 ? 'white' : '#f8fafc',
                    borderBottom: '1px solid #f1f5f9',
                    transition: 'all 0.3s ease'
                  }}
                  onMouseEnter={(e) => {
                    e.currentTarget.style.backgroundColor = '#f0f9ff';
                    e.currentTarget.style.transform = 'translateY(-2px)';
                    e.currentTarget.style.boxShadow = '0 8px 25px rgba(0, 0, 0, 0.1)';
                  }}
                  onMouseLeave={(e) => {
                    e.currentTarget.style.backgroundColor = index % 2 === 0 ? 'white' : '#f8fafc';
                    e.currentTarget.style.transform = 'translateY(0)';
                    e.currentTarget.style.boxShadow = 'none';
                  }}
                >
                  <td style={{ 
                    padding: '20px 24px',
                    color: 'black'
                  }}>
                    <div style={{
                      display: 'flex',
                      alignItems: 'center',
                      gap: '16px'
                    }}>
                      <div style={{
                        width: '56px',
                        height: '56px',
                        borderRadius: '16px',
                        backgroundColor: getTransactionBgColor(t.TipTranzactie),
                        display: 'flex',
                        alignItems: 'center',
                        justifyContent: 'center',
                        fontSize: '24px',
                        border: `2px solid ${getTransactionColor(t.TipTranzactie)}20`
                      }}>
                        {getTransactionIcon(t.TipTranzactie)}
                      </div>
                      <div>
                        <div style={{
                          fontSize: '18px',
                          fontWeight: '700',
                          color: getTransactionColor(t.TipTranzactie),
                          marginBottom: '4px'
                        }}>
                          {t.TipTranzactie}
                        </div>
                        <div style={{
                          fontSize: '14px',
                          color: '#64748b',
                          fontWeight: '500'
                        }}>
                          ID: #{t.IDTranzactie} â€¢ User: {t.IDUtilizator}
                        </div>
                      </div>
                    </div>
                  </td>
                  <td style={{ 
                    padding: '20px 24px', 
                    textAlign: 'right',
                    color: 'black'
                  }}>
                    <div style={{
                      fontSize: '24px',
                      fontWeight: '800',
                      color: getTransactionColor(t.TipTranzactie),
                      marginBottom: '4px'
                    }}>
                      {t.TipTranzactie === 'Depunere' ? '+' : '-'}{t.Suma.toLocaleString('ro-RO')} RON
                    </div>
                    <div style={{
                      fontSize: '14px',
                      color: '#64748b',
                      fontWeight: '500'
                    }}>
                      {t.TipTranzactie === 'Depunere' ? 'CreÈ™tere sold' : 'ScÄƒdere sold'}
                    </div>
                  </td>
                  <td style={{
                    padding: '20px 24px',
                    textAlign: 'center',
                    fontWeight: '600',
                    color: '#64748b'
                  }}>
                    {new Date(t.DataTranzactie).toLocaleString('ro-RO', {
                      day: '2-digit',
                      month: '2-digit',
                      year: 'numeric',
                      hour: '2-digit',
                      minute: '2-digit',
                      hour12: false
                    })}
                  </td>
                  <td style={{
                    padding: '20px 24px',
                    textAlign: 'center',
                    fontWeight: '600',
                    color: '#10b981' // verde procesat
                  }}>
                    ProcesatÄƒ
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default Tranzactii;
